/**
 * Function Validator CNPJ
 * @param {int} cnpj
 */
export function maskCNPJ(value) {
  value = value.replace(/\D/g, '');
  return value.replace(
    /^(\d{2})(\d{3})(\d{3})(\d{4})(\d{2})/,
    '$1.$2.$3/$4-$5'
  );
}
